import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Home() {
  const [urls, setUrls] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/urls')  // ⚠️ make sure your backend is running!
      .then(res => setUrls(res.data))
      .catch(err => {
        console.error('Error fetching URLs:', err);
        // setUrls([]); // Optional fallback
      });
  }, []);

  return (
    <div>
      <h2>My URLs</h2>
      <ul>
        {urls.map((url) => (
          <li key={url._id}>{url.title || url.url}</li>
        ))}
      </ul>
    </div>
  );
}

export default Home;
